import "bootstrap";




import 'mapbox-gl/dist/mapbox-gl.css'; // <-- you need to uncomment the stylesheet_pack_tag in the layout!

import { initMapbox } from '../plugins/init_mapbox';

import {search} from  "../components/algolia";
// initMapbox();
search();


import bootstrapDatetimePicker from "bootstrap-datetimepicker-npm/src/js/bootstrap-datetimepicker.js";
import "bootstrap-datetimepicker-npm/build/css/bootstrap-datetimepicker.min.css";

bootstrapDatetimePicker($);

$('#booking_end_datetime').datetimepicker({
  inline: true,
  sideBySide: true
});

$('#booking_start_datetime').datetimepicker({
  inline: true,
  sideBySide: true
});
